import React, { useState } from "react";
import "./landing-page.css";

const Landing = () => {
    const [sidebarCollapsed, setSidebarCollapsed] = useState(false);
    const [activeCategory, setActiveCategory] = useState("All Products");
    const [activeMenuItem, setActiveMenuItem] = useState("Dashboard");
  
    const toggleSidebar = () => {
      setSidebarCollapsed(!sidebarCollapsed);
    };
  
    const handleCategoryClick = (category) => {
      setActiveCategory(category);
    };
  
    const handleMenuItemClick = (item) => {
      setActiveMenuItem(item);
    };
  
    const handleAddToCart = () => {
      alert("Item added to cart!");
    };
  
    return (
      <div className="container">
        {/* Top Navigation Bar */}
        <div className="top-nav">
          <button className="toggle-sidebar" onClick={toggleSidebar} title="Toggle Sidebar">
            <i className={`fas ${sidebarCollapsed ? "fa-expand" : "fa-bars"}`} />
          </button>
          <div className="logo">
            <i className="fas fa-shopping-cart" /> RetailPro
          </div>
          <div className="search-container">
            <div className="search-bar">
              <input type="text" className="search-input" placeholder="Search products by name, SKU, or barcode..." />
              <button className="search-button">
                <i className="fas fa-search" /> <span>Search</span>
              </button>
            </div>
          </div>
          <div className="user-controls">
            <button className="cart-button" onClick={() => (window.location.href = "shoppingcart.html")}>
              <i className="fas fa-shopping-cart" />
            </button>
            <div className="user-info">
              <img src="/api/placeholder/40/40" alt="User avatar" />
              <span>Alex</span>
            </div>
          </div>
        </div>
  
        {/* Category Tabs */}
        <div className="categories-bar">
          {["All Products", "Electronics", "Clothing", "Home & Kitchen", "Toys", "Sporting Goods", "Business & Industrial", "Jewelry & Watches", "Refurbished"].map((category) => (
            <div
              key={category}
              className={`category-tab ${activeCategory === category ? "active" : ""}`}
              onClick={() => handleCategoryClick(category)}
            >
              {category}
            </div>
          ))}
        </div>
  
        <div className="main-area">
          {/* Sidebar */}
          <aside className={`sidebar ${sidebarCollapsed ? "collapsed" : ""}`}>
            <ul className="sidebar-menu">
              {["Dashboard", "Products", "Shopping Cart", "Customers", "Reports", "Inventory", "Discounts", "Settings", "Help"].map((item) => (
                <li
                  key={item}
                  className={activeMenuItem === item ? "active" : ""}
                  onClick={() => handleMenuItemClick(item)}
                >
                  <i className={`fas fa-${item.toLowerCase().replace(/ /g, "-")}`} /> {item}
                </li>
              ))}
            </ul>
          </aside>
  
          {/* Main Content */}
          <main className="main-content">
            <div className="filter-options">
              <div className="filter-label">Sort by:</div>
              <select className="filter-select">
                <option>Newest First</option>
                <option>Price: Low to High</option>
                <option>Price: High to Low</option>
                <option>Best Selling</option>
              </select>
              <div className="filter-label">In Stock:</div>
              <select className="filter-select">
                <option>All Items</option>
                <option>In Stock Only</option>
                <option>Out of Stock</option>
              </select>
            </div>
  
            {/* Product Grid */}
            <div className="product-grid">
              {[
                { title: "Wireless Headphones", price: "$129.99", stock: 24 },
                { title: "Smart Watch", price: "$199.99", stock: 12 },
                { title: "Bluetooth Speaker", price: "$79.99", stock: 18 },
                { title: "Smartphone Case", price: "$24.99", stock: 56 },
                { title: "Laptop Bag", price: "$49.99", stock: 9 },
                { title: "Wireless Mouse", price: "$34.99", stock: 32 },
              ].map((product, index) => (
                <div key={index} className="product-card" onClick={handleAddToCart}>
                  <div className="product-image">
                    <img src="/api/placeholder/150/150" alt={product.title} />
                  </div>
                  <div className="product-details">
                    <div className="product-title">{product.title}</div>
                    <div className="product-price">{product.price}</div>
                    <div className="product-inventory">In stock: {product.stock}</div>
                  </div>
                </div>
              ))}
            </div>
          </main>
        </div>
      </div>
    );
  };

export default Landing;
